import React, { useState } from "react";

import Menu from "./menu.js";
import List from "./list.js";
import NewItemPopup from "./newitempopup.js";

const BOOLEAN = { true: "true", false: "false" };

function Home({ createNewNotebook }) {
  const [popupShown, setPopupShown] = useState(BOOLEAN.false);

  switch (popupShown) {
    case BOOLEAN.true:
      return (
        <div className="home-container">
          <Menu setPopupShown={setPopupShown} />
          <List editNotebook={editNotebook}/>
          <NewItemPopup createNewNotebook={createNewNotebook} />
        </div>
      );
    case BOOLEAN.false:
      return (
        <div className="home-container">
          <Menu setPopupShown={setPopupShown} />
          <List editNotebook={editNotebook}/>
        </div>
      );
  }
}

export default Home;
